Riding Stick Shift 

Staci Silverstone, Keiran Lee 

tlib Teens Like It Big February 26, 2013

Staci's pop is buying her a used car, but it's not Keiran old smashed up car she wants, it's his sweet sports car... and he's not selling. This eighteen-year-old plans on getting exactly what she wants, so when Keiran agrees to let her test-drive it with her, she goes straight for the stick. 

